import React from "react";
import "./popularRestaurants.css";
import RestaurantCard from "./reataurantCard/RestaurantCard";
import IRestaurantCard from "../../../../types/interfaces/IRestaurantCard";
import data from "../../../../data.json";


const PopularRestaurants: React.FC = () => {
    const restaurantsToRender:IRestaurantCard[] = [];
    data.chefs.map((item)=>item.restaurants.map((item)=>item.isPopular==true&&restaurantsToRender.push(item)));

      return (
          <div id="popular-restaurants">
              <h2>popular restaurant in epicure:</h2>
              <div>
                <RestaurantCard img={data.chefs.img} name={restaurantsToRender.name} chef={restaurantsToRender.chef} rating={restaurantsToRender.rating}/>
              </div>
          </div>
      );
    }

export default PopularRestaurants;
